import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { predictPCOS, predictPCOSFromImage, predictWithFusion } from './api';

// Components
import ClinicalForm from './components/ClinicalForm';
import ImageUpload from './components/ImageUpload';
import ResultDisplay from './components/ResultDisplay';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

// Pages
import Home from './pages/Home';
import About from './pages/About';
import ClinicalDetection from './pages/ClinicalDetection';
import UltrasoundDetection from './pages/UltrasoundDetection';
import FusionDetection from './pages/FusionDetection';

const App = () => {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50 flex flex-col">
        <Navbar appName="OvaDetect" />
        
        <main className="flex-grow container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/clinical-detection" element={<ClinicalDetection />} />
            <Route path="/ultrasound-detection" element={<UltrasoundDetection />} />
            <Route path="/fusion-detection" element={<FusionDetection />} />
          </Routes>
        </main>
        
        <Footer appName="OvaDetect" />
      </div>
    </Router>
  );
};

export default App;
